import React from "react";

export default function App() {
  return (
    <div className="container">
      <div className="row">
        <div className="col">
          <select name="filter">
            <option value="">No Filter</option>
            <option value="male">Male</option>
            <option value="female">Female</option>
          </select>
        </div>
      </div>
      <div className="row"></div>
    </div>
  );
}
